import React from "react";

const Lists = (props) => {
  const { listitems, deleteTask, handleOnChange } = props;

  const handleOnDelete = (task) => {
    deleteTask(task);
  }

  return (
    <div className="toDoData">
      {listitems === "" ?
        <button> no todos</button>
        :
        <div className="data" style={{ display: 'flex', justifyContent: 'space-between', flexDirection: 'column' }}>
{
  listitems.map((item, index) => {
    return (
      <div key={index} >
        <div>
          <label>
            <input
              type="checkbox"
              checked={item.status === 'complete'}
              onClick={(event) => handleOnChange(event, item)}
            />
            {item.title}
          </label>
          <button
            onClick={() => handleOnDelete(item)}
            style={{ height: '30px' }}
          >
            Delete
          </button>
        </div>
      </div>
    );
  })
}
        </div>
      }
    </div>
  )
}

export default Lists;
